                    { new Guid("1ce4dafb-f35d-4850-ac19-60a69d7e72e2"), "Refrigerator won't turn on", 139m, "If the voltage is higher or lower than the specified range, then the refrigerator may simply not turn on. Remove the terminals from the wires connected to the thermostat and connect them together. If the refrigerator does not turn on and the light inside the refrigerator does not light up, then most likely the problem is precisely in the lack of power. Check if everything is in order with the cord, plug and socket.", new Guid("a9bb431e-6989-4b05-9ced-04e87fe89161") },
                    { new Guid("1d8263d6-ea2d-4df8-9f81-9fec87f49a2e"), "The kettle that is plugged in does not heat the water", 151m, "As a rule, TEN cannot be repaired. The disk heater is part of the body, it is not advisable to change half of the kettle. In cases where the heater burns out, we advise you to buy a new device.", new Guid("aa4ac60d-6ed2-454e-b130-eb0d19e7fb62") },
                    { new Guid("1dab76c2-4629-408d-beee-e2f210280323"), "A thin cable can be torn if it is constantly pulled with force or strongly pulled", 243m, "Such a malfunction is more difficult to detect, especially if a budget model is used, which has very thin wires or damage to the driver itself. It is not possible to see the break with the eyes, since the insulation will remain intact. In this case, diagnostics will be required and only then repair of the headphones. ", new Guid("51261fc6-ea49-4264-9cf6-b4c1c27c0b18") },
                    { new Guid("1e914617-0355-4c15-9fd2-4e25591b6a6f"), "Moisture ingress", 212m, "Immediately after the incident, you need to turn off the gadget and try to dry it (if the battery is removable, then pull it out). Do not use a hair dryer or heat the device in any other way. Otherwise, there is a high risk of burning the electronics, and then even contacting a service center will not help.", new Guid("8b2cc695-f5cf-4bed-a2c5-de5d7f691a3d") },
