                    { new Guid("20b06c0a-155a-4ee2-8194-0d5de141264c"), "Moisture ingress", 218m, "Immediately after the incident, you need to turn off the gadget and try to dry it (if the battery is removable, then pull it out). Do not use a hair dryer or heat the device in any other way. Otherwise, there is a high risk of burning the electronics, and then even contacting a service center will not help.", new Guid("e730b0b4-c7e3-4da1-b884-9c32d26d246d") },
