                    { new Guid("234699ba-e265-43c4-946d-8ce1e8e1c8b5"), "There is no picture on the TV, but there is sound", 312m, "If the screen does not glow when turned on, then first of all you need to check its connection to the power source, whether the cord has been pulled out of the socket. Check the cable along its entire length for deformation. It also needs to be removed from the nest and inserted again. Make sure the plug is in working order and fits snugly into the socket.", new Guid("b295070d-44f1-4a70-b2d3-1487acef8465") },
                    { new Guid("2361bef0-a17d-4e81-89c4-25bb8df136db"), "A thin cable can be torn if it is constantly pulled with force or strongly pulled", 133m, "Such a malfunction is more difficult to detect, especially if a budget model is used, which has very thin wires or damage to the driver itself. It is not possible to see the break with the eyes, since the insulation will remain intact. In this case, diagnostics will be required and only then repair of the headphones. ", new Guid("1f1a0f84-f345-42ce-b7d2-8cfd01c22215") },
