                    { new Guid("25433b11-91da-4009-b577-a41a2519ac66"), "Refrigerator is freezing cold", 192m, "The thermostat must either be replaced or sent in for repair for adjustment. Make sure the seal fits snugly against the door and sides of the refrigerator. If defects are found, the seal must be replaced.", new Guid("39495234-5cd9-474e-a661-b7456c30b3cf") },
                    { new Guid("25d7944a-a64b-47aa-996b-072a87bedb29"), "Noisy", 281m, "Another malfunction that can occur in a carob coffee maker is an uncharacteristic noise for the device: crackling, whistling or loud hissing. The reason for this may be a clogged filter or mesh in the horn. In this case, you will need to carefully disassemble and clean the structure with the help of special care products for coffee machines and coffee makers, as well as a soft brush, which is often supplied with the device.", new Guid("e0c0ea29-a821-4f8f-92ee-c61b71d1191f") },
