                    { new Guid("7e76caa4-647e-4771-a9e9-b42d561578b0"), "The system unit beeps continuously, does not boot/reboot", 72m, "Recognize the type of squeak. Fault beep combinations differ from each other, depending on the manufacturer of the motherboard. Here are the most common beeps of several BIOS faults: a) Award Bios1 long, 3 short - video card not detected or defective.", new Guid("c1147ddd-240a-4c1b-9d69-edd89bb9f2ca") },
