                    { new Guid("7fad8a4f-5f83-4607-afca-6f0245034b56"), "Heating element damage", 131m, "The heating element breaks extremely rarely. However, if this still happened, then it is easier to buy a new iron, instead of trying to replace the heating element. You can determine that the breakdown is related specifically to the heating element as follows.", new Guid("4e75b1ad-0c3c-4f32-b6a7-3dec3881c465") },
