                    { new Guid("823f98cc-2477-49a9-b942-7d1ae9bb6b94"), "Moisture ingress", 306m, "Immediately after the incident, you need to turn off the gadget and try to dry it (if the battery is removable, then pull it out). Do not use a hair dryer or heat the device in any other way. Otherwise, there is a high risk of burning the electronics, and then even contacting a service center will not help.", new Guid("ffaa94dc-ebfd-48b1-9dd9-d025f30242d1") },
                    { new Guid("82e525db-97d1-45a2-836b-19f70f877977"), "A thin cable can be torn if it is constantly pulled with force or strongly pulled", 244m, "Such a malfunction is more difficult to detect, especially if a budget model is used, which has very thin wires or damage to the driver itself. It is not possible to see the break with the eyes, since the insulation will remain intact. In this case, diagnostics will be required and only then repair of the headphones. ", new Guid("8cc07181-ca2f-40c5-91e1-c38b1ef5d258") },
