                    { new Guid("b6d8d1d8-7a4f-4e50-a1b8-bfa9745cfbe2"), "There is no picture on the TV, but there is sound", 257m, "If the screen does not glow when turned on, then first of all you need to check its connection to the power source, whether the cord has been pulled out of the socket. Check the cable along its entire length for deformation. It also needs to be removed from the nest and inserted again. Make sure the plug is in working order and fits snugly into the socket.", new Guid("c2863dce-b308-4097-a63e-0a6298b9d237") },
                    { new Guid("b91fe007-ea86-4485-b7ff-ea9dfd404cdd"), "The kettle that is plugged in does not heat the water", 143m, "As a rule, TEN cannot be repaired. The disk heater is part of the body, it is not advisable to change half of the kettle. In cases where the heater burns out, we advise you to buy a new device.", new Guid("b1e494b9-3772-495c-8379-8601196c3d0c") },
                    { new Guid("b969e802-e4f2-44f1-b238-6837a7bb721f"), "No sound on TV", 48m, "Try turning up the volume using the buttons on the manual control panel. It is not necessary to buy the original remote control, you can get by with the purchase of a universal device.", new Guid("186ca260-4d3f-43a3-9a79-131212de9eff") },
                    { new Guid("b9dc827d-bbf7-4412-b4f8-420447b62b62"), "A thin cable can be torn if it is constantly pulled with force or strongly pulled", 43m, "Such a malfunction is more difficult to detect, especially if a budget model is used, which has very thin wires or damage to the driver itself. It is not possible to see the break with the eyes, since the insulation will remain intact. In this case, diagnostics will be required and only then repair of the headphones. ", new Guid("90e12c2c-c7dc-41f2-b599-64e1ff9fd32a") },
                    { new Guid("ba7c8353-1e3c-48ac-be62-594ebb0c2c28"), "Damage to the thermostat", 214m, "After the plastic part of the case has been removed, you should consider the thermostat of the iron. In cold mode, the contacts must be closed. If there is a special device, it is better to ring the knot. If there is no device, you can clean the contacts with fine sandpaper, and then plug the iron into the network.", new Guid("b4aed8b7-c096-42e2-a9ba-c3655b448557") },
                    { new Guid("bab9fd58-d17e-413c-b67b-fd47abe1a4c2"), "The kettle turns off before the water boils", 58m, "Breakdowns of teapots are different. To find out if the kettle is repairable or not, order a free diagnostic service. The service center master will inspect the device, disassemble and determine the feasibility of repairing. If the appliance is beyond repair or the cost is high, you can safely buy a new kettle.", new Guid("f94d28d3-095c-4781-85b5-70d667f9798f") },
                    { new Guid("bbb03024-eb2c-4141-8adf-e455077ce728"), "Refrigerator is freezing cold", 317m, "The thermostat must either be replaced or sent in for repair for adjustment. Make sure the seal fits snugly against the door and sides of the refrigerator. If defects are found, the seal must be replaced.", new Guid("d0d35e79-84de-4e2a-8fec-a9a354b24c42") },
                    { new Guid("bbcf6fe6-6740-4a7a-af4f-172244df6077"), "The machine does not heat water", 265m, "In this case, you need to arm yourself with a multimeter and ring the heating element, and then the controller. If there is heating, but it is insufficient, hard water, which provoked the appearance of scale on the heating element, may be to blame. In this case, it is necessary to flush the machine with a special cleaning agent and install a filter cartridge to soften the water. If this operation fails, it is necessary to replace the heating element, which is performed by a service center specialist.", new Guid("4acd5510-be94-4ca4-bb82-155c5e028165") },
                    { new Guid("bc40c2fc-2973-4c96-b22c-4b71a1c157b7"), "Doesn't turn on", 232m, "There can be many reasons for this most common problem, ranging from failures in the operating system to malfunctioning boards. Also, the reason may be an unsuccessful flashing, and sometimes the phone simply cannot charge due to a clogged port.", new Guid("62614033-ef87-48a0-8a32-3bb4f013b076") },
                    { new Guid("bd131b12-6882-418e-9b80-80f67d7b7f01"), "Water flows from the kettle", 172m, "The cause of the malfunction is in the glass with the water meter scale. The seals in the body are worn out if the heater is of an open type.", new Guid("8d2cf44b-59e2-4370-9922-286d71bed487") },
