                    { new Guid("c052089a-7015-49f7-8da2-526ad8dc0b7e"), "Refrigerator is freezing cold", 307m, "The thermostat must either be replaced or sent in for repair for adjustment. Make sure the seal fits snugly against the door and sides of the refrigerator. If defects are found, the seal must be replaced.", new Guid("bb2471be-b3a3-4e88-a5b3-8ac23a7dfed1") },
