                    { new Guid("d678edfa-c9b2-408c-b8d2-c37dbcd294ec"), "Moisture ingress", 54m, "Immediately after the incident, you need to turn off the gadget and try to dry it (if the battery is removable, then pull it out). Do not use a hair dryer or heat the device in any other way. Otherwise, there is a high risk of burning the electronics, and then even contacting a service center will not help.", new Guid("fe5e14ee-50ac-4317-97f0-1517e534863f") },
                    { new Guid("d790878b-c975-4b97-a9e0-999bf736118c"), "Refrigerator is freezing cold", 166m, "The thermostat must either be replaced or sent in for repair for adjustment. Make sure the seal fits snugly against the door and sides of the refrigerator. If defects are found, the seal must be replaced.", new Guid("e9373d4c-5662-42b7-b708-67de8f662c5f") },
                    { new Guid("d7a09625-6cce-4e87-a6ab-1fc59ce34e9d"), "Power cord damage", 107m, "Attach the end of the tester with the bulb to the plug, and the battery to the other end of the cord. If the light does not come on, then the problem is in the cord. It needs to be shortened and checked again.", new Guid("72d16905-76f8-484c-983a-8bf00e7b0b04") },
                    { new Guid("d7a57488-98b8-4f95-bd7c-31bf46c52b1a"), "Doesn't turn on", 153m, "There can be many reasons for this most common problem, ranging from failures in the operating system to malfunctioning boards. Also, the reason may be an unsuccessful flashing, and sometimes the phone simply cannot charge due to a clogged port.", new Guid("b6fb642d-3617-45ad-b771-c7501c2e7759") },
                    { new Guid("d7c84727-7af1-4036-90a4-1bf2949aede8"), "Moisture ingress", 261m, "Immediately after the incident, you need to turn off the gadget and try to dry it (if the battery is removable, then pull it out). Do not use a hair dryer or heat the device in any other way. Otherwise, there is a high risk of burning the electronics, and then even contacting a service center will not help.", new Guid("edd2b5d0-e28b-4d76-9c26-394dcdefd5e2") }
