                    { new Guid("de74d058-cb3e-47fc-8b1d-5a5f8fa741a7"), "The kettle that is plugged in does not heat the water", 114m, "As a rule, TEN cannot be repaired. The disk heater is part of the body, it is not advisable to change half of the kettle. In cases where the heater burns out, we advise you to buy a new device.", new Guid("2707342d-ca47-435a-af52-5c18a76e5023") },
