                    { new Guid("f3296fce-53d0-4848-9b7e-a2b3a7fe9154"), "Refrigerator won't turn on", 269m, "If the voltage is higher or lower than the specified range, then the refrigerator may simply not turn on. Remove the terminals from the wires connected to the thermostat and connect them together. If the refrigerator does not turn on and the light inside the refrigerator does not light up, then most likely the problem is precisely in the lack of power. Check if everything is in order with the cord, plug and socket.", new Guid("66a5e8e7-9060-4553-963b-8dd2b4a6f7d9") },
                    { new Guid("f343fe23-184a-4ac9-a34b-1472358169d3"), "Doesn't respond when turned on", 315m, "Check if the plugs on the shield have been knocked out, if there is light in the house, and if the filters of the device are clogged - perhaps the solution to the problem will be much easier!", new Guid("35ba5c0e-2e74-4912-a715-057f6943917f") },
                    { new Guid("f3d85824-af51-4dad-923c-a753fb517461"), "The kettle that is plugged in does not heat the water", 125m, "As a rule, TEN cannot be repaired. The disk heater is part of the body, it is not advisable to change half of the kettle. In cases where the heater burns out, we advise you to buy a new device.", new Guid("c5a605c6-fc88-44d9-9a2e-fd18b659902e") },
                    { new Guid("f3e2ad81-7abe-4ead-a3db-29c544e59ab4"), "There is no picture on the TV, but there is sound", 300m, "If the screen does not glow when turned on, then first of all you need to check its connection to the power source, whether the cord has been pulled out of the socket. Check the cable along its entire length for deformation. It also needs to be removed from the nest and inserted again. Make sure the plug is in working order and fits snugly into the socket.", new Guid("d211cc71-1bb7-4f68-a1d6-01ee1a9e0a58") },
                    { new Guid("f42bf342-ddfc-4470-b623-e36bb4d0eae6"), "Refrigerator is freezing cold", 153m, "The thermostat must either be replaced or sent in for repair for adjustment. Make sure the seal fits snugly against the door and sides of the refrigerator. If defects are found, the seal must be replaced.", new Guid("b5964aa8-4332-48f0-ae71-5c21b4408be8") },
                    { new Guid("f4c19828-afeb-452f-8895-9678f863f097"), "No sound on TV", 136m, "Try turning up the volume using the buttons on the manual control panel. It is not necessary to buy the original remote control, you can get by with the purchase of a universal device.", new Guid("27be17b2-68f4-4cd4-94b6-b0fda72f6467") },
                    { new Guid("f564248e-463a-4563-a892-941d3fb7e5b1"), "A thin cable can be torn if it is constantly pulled with force or strongly pulled", 67m, "Such a malfunction is more difficult to detect, especially if a budget model is used, which has very thin wires or damage to the driver itself. It is not possible to see the break with the eyes, since the insulation will remain intact. In this case, diagnostics will be required and only then repair of the headphones. ", new Guid("05a8dbd9-a247-4d65-8ca0-a0e7d2e8c6aa") },
                    { new Guid("f58d6fa6-db97-4f7a-93fa-ef3a6d037db8"), "Doesn't respond when turned on", 319m, "Check if the plugs on the shield have been knocked out, if there is light in the house, and if the filters of the device are clogged - perhaps the solution to the problem will be much easier!", new Guid("ec6d7068-d15a-45b3-9605-5f2d7441d6c4") },
                    { new Guid("f5b9b74b-f764-4133-8bdf-8bc5db8c2ceb"), "Damage to the contact", 299m, "The solution to the problem is to solder them in place. In addition, the repair may consist in replacing the plug, taking into account the pinout of the headphones. ", new Guid("26c7afbf-7f32-4bae-9934-94f452f3bd01") },
                    { new Guid("f61eb0e0-e210-4e8d-aeb9-df85d6813660"), "Water flows from the kettle", 87m, "The cause of the malfunction is in the glass with the water meter scale. The seals in the body are worn out if the heater is of an open type.", new Guid("7b91a738-2886-4af6-9511-bc2edc7819da") },
                    { new Guid("f6aaa0db-8858-4b8d-8c74-3efdc643fe1c"), "The machine does not heat water", 326m, "In this case, you need to arm yourself with a multimeter and ring the heating element, and then the controller. If there is heating, but it is insufficient, hard water, which provoked the appearance of scale on the heating element, may be to blame. In this case, it is necessary to flush the machine with a special cleaning agent and install a filter cartridge to soften the water. If this operation fails, it is necessary to replace the heating element, which is performed by a service center specialist.", new Guid("71c6de8b-88f7-4689-8f1b-0882a8d6cf31") },
                    { new Guid("f6cbacf4-dd17-48ce-a851-b4319ad9501a"), "No signal on TV", 122m, "Therefore, you need to start with the diagnosis. When the user determines the reason for the absence of a signal, he will be able to develop the best course of action in accordance with expert recommendations. Start your troubleshooting with a thorough inspection of all connectors. Make sure the wires are not kinked or broken. The condition of the cable directly affects the quality of the broadcast. To avoid such problems, it is extremely important to know how to choose a coaxial cable.", new Guid("f0ff3d8a-3e90-4e2f-a693-328c87183dfb") },
                    { new Guid("f6cf6f8b-390f-4759-8883-bad41ab0fb8f"), "Control system not working", 136m, "In some cases, the search for a defect is forced to remove the control panel - this way you can check the condition of the contacts with a special tester. The cause of the malfunction may be contamination of the mechanical buttons - sunken elements must be removed, cleaned and reinstalled.", new Guid("ec6d7068-d15a-45b3-9605-5f2d7441d6c4") },
                    { new Guid("f72e7355-77f5-4164-b7ee-629fbb285da1"), "Damage to the contact", 173m, "The solution to the problem is to solder them in place. In addition, the repair may consist in replacing the plug, taking into account the pinout of the headphones. ", new Guid("35457392-048c-4eb7-9e8b-8875a2a174c5") },
                    { new Guid("f7781585-d1c1-40c3-8777-67017acd443c"), "A frequent malfunction when one earpiece fails", 173m, "To repair an earphone, experience is required, so it is better to immediately contact the specialists without doing anything on your own.", new Guid("35457392-048c-4eb7-9e8b-8875a2a174c5") },
                    { new Guid("f793f825-de43-4b6c-a500-4053779f0ece"), "Damage to the thermostat", 156m, "After the plastic part of the case has been removed, you should consider the thermostat of the iron. In cold mode, the contacts must be closed. If there is a special device, it is better to ring the knot. If there is no device, you can clean the contacts with fine sandpaper, and then plug the iron into the network.", new Guid("4b66205a-d075-47c2-8178-266dc568d509") },
                    { new Guid("f96c1a6e-8581-4701-bd39-4b2685bd5575"), "The system unit does not turn on, the Power indicator does not light up", 323m, "Check the connection of the video cables of the monitor. Check the monitor's power cable.", new Guid("4355e502-f76f-48ac-8c6b-4c2c634ca0f1") },
                    { new Guid("f9988f01-1992-4c20-b081-528be334ef86"), "Doesn't respond when turned on", 226m, "Check if the plugs on the shield have been knocked out, if there is light in the house, and if the filters of the device are clogged - perhaps the solution to the problem will be much easier!", new Guid("0f777b95-2578-42c7-8da1-dfd8020e48b8") },
                    { new Guid("fa6007bf-a719-4831-9d9d-a53c688e0284"), "The kettle turns off before the water boils", 182m, "Breakdowns of teapots are different. To find out if the kettle is repairable or not, order a free diagnostic service. The service center master will inspect the device, disassemble and determine the feasibility of repairing. If the appliance is beyond repair or the cost is high, you can safely buy a new kettle.", new Guid("039a99fa-785a-47d8-ad1f-5f0d285c4fc4") },
                    { new Guid("fa747242-8817-4aa5-b31b-f3f282b3e458"), "The kettle turns off before the water boils", 227m, "Breakdowns of teapots are different. To find out if the kettle is repairable or not, order a free diagnostic service. The service center master will inspect the device, disassemble and determine the feasibility of repairing. If the appliance is beyond repair or the cost is high, you can safely buy a new kettle.", new Guid("7b91a738-2886-4af6-9511-bc2edc7819da") },
