                    { new Guid("fb55decb-f209-499a-a2e2-1e344e7e6d8b"), "Doesn't respond when turned on", 90m, "Check if the plugs on the shield have been knocked out, if there is light in the house, and if the filters of the device are clogged - perhaps the solution to the problem will be much easier!", new Guid("58c5cb8c-27d9-4ba0-86db-cacfc92fd91f") },
                    { new Guid("fc619cc0-8e32-4d62-8634-537c51bb6ac9"), "Power cord damage", 30m, "Attach the end of the tester with the bulb to the plug, and the battery to the other end of the cord. If the light does not come on, then the problem is in the cord. It needs to be shortened and checked again.", new Guid("be9f86fa-25ac-4529-afea-60792672938c") },
                    { new Guid("fd249e00-9edd-465e-9c17-5093231dfc9a"), "No sound on TV", 309m, "Try turning up the volume using the buttons on the manual control panel. It is not necessary to buy the original remote control, you can get by with the purchase of a universal device.", new Guid("1266a5e7-06a4-4972-8277-6b06e785a7ba") },
